import { Amazer, AmazerBuilder, RandomizedPrim, Emmure, BreakPassages } from "amazer"

export default function generateMaze() {
  const config = new AmazerBuilder()
    .withSize({ width: 20, height: 20 })
    .andModifier(Emmure)
    .using(RandomizedPrim)
    .andModifier(BreakPassages, {
      amoutn: 50,
      minimumShortcutDistance: 50
    })
    .build()

  return new Amazer(config).generate()
}
